// import { message } from "antd";

import { message } from "antd"
import { createStore } from "redux";

const abc =  
{
    message : " "
}

function reducer (state = abc , action)
{
    switch(action.type)
    {
        case 'msg':
            return{
                message : "hello"
            }
            break;
        default:
            return state;
            break;

    }
}

const Store = createStore(reducer);

export default Store;
